import React from "react";

const Info = () => {
  return (
    <div>
      <h3>
        <TypeWriterEffect
          textStyle={
            action.darkMode ? writerStyle : { ...writerStyle, color: "black" }
          }
          startDelay={900}
          cursorColor="blue"
          multiText={["Hi! My name is Suraj Poddar. I'm a Frontend Developer","I live in Prayagraj City, and I'm currently a second year student pursuing Bachelor's degree in Computer Science from Kalinga Institute of Industrial Technology.", "I love singing song and watching movies."]}
          loop={true}
          nextTextDelay={1000}
        />
      </h3>
    </div>
  );
};

export default Info;
